/* eslint-disable */
import axios from "axios";

function Search(breed, typeSelect, names) {
  const arr = names.split(" ");
  var vars = [{}];

  for (var i in arr) {
    var queryWords = breed + " " + arr[i] + "\n";
    vars.push({ key: queryWords, value: "none" });
  }

  return vars;
}

export default Search;
